import * as React from 'react';
import { List, Datagrid, TextField } from 'react-admin';


export const TournamentList = (props: any) => {
    return (
        <List {...props}>
            <Datagrid>
                <TextField source="id" />
                <TextField source="name" />
                <TextField source="description" />
            </Datagrid>
        </List>
    );
};
